    false,nt"url": null,nt"notes": "  Alaska Native Regional Corporations (ANRCs)
    were created pursuant to the Alaska Native Claims Settlement Act (ANCSA), which
    isn               federal legislation Pub. L. 92-203, 85 Stat. 688 (1971); 43 U.S.C.
    1602 et seq. (2000)) enacted in 1971, as a 'Regional Corporation' and organized
    undern               the laws of the State of Alaska as "Regional Corporations"
    to conduct both the for profit and non profit affairs of Alaska Natives withinn
                  defined regions of Alaska. Twelve ANRCs cover the entire State of
    Alaska except for the area within the Annette Island Reserve (an American Indiann
                  Reservation under the governmental authority of the Metlakatla Indian
    Community). There is a thirteenth ANRC that represents the eligible Alaska Nativesn
                  living outside of Alaska that are not members of any of the twelve
    ANRCs within the State of Alaska. Because it has no defined geographic extent, thisn
                  thirteenth ANRC does not appear in the TIGER/Line Shapefiles and
    the Census Bureau does not provide data for it. The Census Bureau offers representativesn
                  of the twelve ANRCs the opportunity to review and update the ANRC
    boundaries. ANRCs are represented by a 5 character FIPS code unique within Alaska
    and an               nationally unique 8 character National Standard (GNIS) code.
